import React from 'react'
import { Link } from 'react-router-dom';

function Header({ view }) {
    return (
        <>
            <nav className="header">
                <div className="header-container">
                    <h1>ITEH CRM 2021</h1>

                </div>
            </nav>
        </>
    )
}

export default Header
